onfig_height":640}],"is_video":false,"accessibility_caption":"Photo by LOVIS TRUMMER in Berlin, Germany with @callimero90. \u6ca1\u6709\u7167\u7247\u63cf\u8ff0\u3002"}},{"node":{"comments_disabled":false,"__typename":"GraphImage","id":"2265618034901502532","edge_media_to_caption":{"edges":[{"node":{"text":"HELLO? IS IT ME YOU'RE LOOKING FOR?\n\nYes, we're going to ride this #love theme all the way to a flattened curve... Corny as it seems, it's truly what the world needs now. Today I received a hug rather than a handshake so that's progress ... right?\n\nBack to our #lovepillow. It's hand woven using hand dyed cotton. It's a QR coded message which says 'Love always finds the way home'. May all those separated by recent world events find their way home to each other. .\n\nABOUT THE PILLOW\nA hand woven piece inspired by woven fabrics such as #kente made through a less intimidating process.\n\nA woven QR code again inspired by the way each Kente piece has a special significance.\n\nThis pillow in particular says ' Love always knows the way home'. We felt it would be nice to have a secret message just for you woven into an aesthetically pleasing decor piece. Do you agree?\n\nMade from 100% cotton and 100% fibre filling, approx. 18x18 inches... #affahome \n#homedecor\n#throwpillows \n#wovenpillow \n#handwoven\n#handwoventextiles \n#handwoventextiles \n#handwoventextilesfromkenya\n#handwoveninkenya\n#madeinkenya\n#madeinnairobi\n#madeinke\n#livingroomdecor"}}]},"shortcode":"B9xF5lXBcpE","edge_media_to_comment":{"count":0},"taken_at_timestamp":1584302738,"dimensions":{"height":1080,"width":1080},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/90094199_517435049191412_3307170035878956775_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=108\u0026_nc_ohc=FPPcNrxWVLEAX86FFC0\u0026oh=6abe50beb58d31b98a775a1f248a1ce9\u0026oe=5E9B147E","edge_liked_by":{"count":0},"edge_media_preview_like":{"count":0},"owner":{"id":"31585093166"},"thumbnail_src
